INSERT INTO `chart` VALUES (1783933563671687170, '测试', '测试', 'data_1714157879663', '折线图', 1783925748412526594, '{\n  \"legend\": {\n    \"data\": [\"num1\", \"num2\", \"num3\"]\n  },\n  \"xAxis\": {\n    \"type\": \"category\",\n    \"data\": [\"Data 1\"]\n  },\n  \"yAxis\": {\n    \"type\": \"value\"\n  },\n  \"series\": [\n    {\n      \"name\": \"num1\",\n      \"type\": \"line\",\n      \"data\": [123]\n    },\n    {\n      \"name\": \"num2\",\n      \"type\": \"line\",\n      \"data\": [456]\n    },\n    {\n      \"name\": \"num3\",\n      \"type\": \"line\",\n      \"data\": [789]\n    }\n  ]\n}', '根据提供的数据，我们可以得出以下结论：\n\n- num1 的值为 123。\n- num2 的值为 456，是三个数值中第二高的。\n- num3 的值为 789，是三个数值中最高的。\n\n这些数据以折线图的形式呈现时，可以直观地看出各个数值之间的相对大小和趋势。不过，由于只提供了一个数据点，无法分析出更多的时间序列趋势或模式。如果有多组数据点，我们可以进一步分析这些数值的变化趋势和潜在的关联性。', 'success', NULL, '2024-04-27 02:58:00', '2024-04-27 02:58:00', 0);
